import React from 'react';
import { Row, Col } from 'antd';
import Maps from './Maps';
import StadiumList from './StadiumList';
import StadiumInfo from './StadiumInfo';

const BattleMap = () => {
    return (
        <div>
            <Row gutter={[0, 16]} type="flex">
                <Col xs={{ span: 22, offset: 1 }} sm={{ span: 22, offset: 1 }} md={{ span: 14, offset: 2 }}>
                    {/* 지도 */}
                    <Maps />
                </Col>

                <Col xs={{ span: 22, offset: 1 }} sm={{ span: 7, offset: 1 }} md={{ span: 5, offset: 1 }}>
                    {/* 리스트 */}
                    <StadiumList />
                </Col>

                <Col xs={{ span: 22, offset: 1 }} sm={{ span: 14, offset: 1 }} md={{ span: 18, offset: 2 }}>
                    {/* 리스트 상세내용 */}
                    <StadiumInfo />
                </Col>
            </Row>
        </div>
    );
};

export default BattleMap;
